const Navbar = () => {
    return(
    <div className="navbar">
        
        <img src="https://assets.zyrosite.com//Aq2xk2nr7Bsq6k12/Niko-logo-YD0Z86WOZ7FQg38b.svg"></img>    
       
        <div className="linksnav">
            <a href="#">MY WORKS</a>
            <a href="#">CONTACT ME</a>
        </div>

    </div>
)
}

export default Navbar;
